const qaList = $json.body.payload.questions_and_answers;

const output = {};

for (const qa of qaList) {
  if (qa.question && qa.answer !== undefined) {
    // Generate key dynamically: lowercase, replace non-alphanumerics with underscores
    const key = qa.question
      .trim()
      .toLowerCase()
      .replace(/[^a-z0-9]+/g, '_') // replace non-alphanumeric characters with underscore
      .replace(/^_+|_+$/g, ''); // remove leading/trailing underscores

    output[key] = qa.answer;
  }
}

return [{ json: output }];
